import React from "react";
import { ProTable } from "@ant-design/pro-table";

const Users = () => {
    const columns = [
        {
            title: "ID",
            dataIndex: "id",
            key: "id",
            valueType: "text",
        },
        {
            title: "Name",
            dataIndex: "name",
            key: "name",
            valueType: "text",
        },
        {
            title: "Price",
            dataIndex: "price",
            key: "price",
            valueType: "money",
        },
        {
            title: "Amount",
            dataIndex: "amount",
            key: "amount",
            valueType: "digit",
        },
    ];

    return (
        <ProTable
            columns={columns}
            request={async (params) => {
                try {
                    const response = await fetch(
                        `http://localhost:8080/api/products`,
                        {
                            method: "GET",
                            headers: {
                                "Content-Type": "application/*",
                                Authorization: "Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJhZG1pbiIsImV4cCI6MTczMzg2MDg4MywiYXV0aCI6IlJPTEVfQURNSU4gUk9MRV9VU0VSIiwiaWF0IjoxNzMzNzc0NDgzfQ.uSle6_mUXKEyyE5CjyRb5o8KF7sY8DsWuV_4iOnsJwvitneHlu8kwLOKjB4ZpzCGaCqtxjpwe7L841VnU8MTYg", // Thay YOUR_ACCESS_TOKEN bằng token thực của bạn
                            },
                        }
                    );

                    // Lấy tổng số bản ghi từ header `X-Total-Count`
                    const total = response.headers.get("X-Total-Count");
                    const data = await response.json();

                    return {
                        data, // Dữ liệu cho bảng
                        total: parseInt(total, 10), // Tổng số bản ghi
                        success: true,
                    };
                } catch (error) {
                    console.error("Error fetching data:", error);
                    return {
                        data: [],
                        total: 0,
                        success: false,
                    };
                }
            }}
            rowKey="id" // Sử dụng `id` làm khóa duy nhất
            search={{
                labelWidth: "auto", // Tự động căn chỉnh nhãn
            }}
            pagination={{
                pageSize: 20, // Số bản ghi mỗi trang
                showSizeChanger: true, // Hiển thị nút thay đổi số bản ghi mỗi trang
                showQuickJumper: true, // Hiển thị hộp nhập nhảy đến trang bất kỳ
            }}
            dateFormatter="string" // Định dạng ngày tháng
        />
    );
};

export default Users;
